B.B4=new A.nl("Dale Devitt","Soil and Water Professor","Dale Devitt is a soil and water scientist specializing in soil-plant-water relationships in arid environments, with emphasis on irrigated systems using low-quality water. He leads the water component of the NSF EPSCoR climate change study at UNLV, overseeing advanced weather station transects in two Nevada mountain ranges. He also directs the Center for Urban Water Conservation, which conducts research on urban water issues. One current project explores the fate of pharmaceuticals in turfgrass irrigated with recycled water. Devitt earned his B.S., M.S., and Ph.D. in soil/environmental science from UC Riverside. He has authored 72 peer-reviewed publications and a book. Outside of work, he supports homelessness organizations, makes wine, and enjoys the outdoors. Expertise: Water Management, Conservation, Quality, Salinity, Evapotranspiration, Climate Change, Biofuels Research Focus: Urban and ecosystem-level water use, including impacts of water diversion and climate change.","https://i.ibb.co/HTHpXcZx/Devitt-214x300.jpg","Department of Life Sciences, 4505 S Maryland Pkwy, Las Vegas, NV 89154","dale.devitt@unlv.edu","+17028954699","https://www.unlv.edu/people/dale-devitt",null)
